let startFrom;
let started = 0;
(async () => {
  try {
    let sum = 0;
 
    let toSend = data
      .map((x, i) => {
        const [address, amount] = x;
        if (!Number.isNaN(Number(amount))) {
          sum += Number(amount);
        }
        if (!startFrom) {
          started = 1;
        }

        if (startFrom && address === startFrom) {
          started = 1;
        }
        if (started) {
          return [address, amount];
        }
      })
      .filter(x => !!x && x[0]);

    // get current amount devide it by existing sum
    // multiply it to 200,000,000

    const accounts = await web3.eth.getAccounts();
    console.log(accounts);    
    const metadata = JSON.parse(await remix.call('fileManager', 'getFile', 'contracts/artifacts/Token.json'))    
    let token = new web3.eth.Contract(metadata.abi, '0x4d3Aefbe7a7f23ACC1E8F388d0d025Ad897F4c14')
    for (let i = 0; i < toSend.length && i < 300000; i++) {
      const item = toSend[i];
      if (!item) {
         break;
      }
      const newAmount = (item[1] / sum) * 200000000;
      await token.methods.mint(item[0], (newAmount * 10) ^ 18, {
        from: accounts[0]
      });
    }
  } catch (error) {
    console.error(error);
  }
})()
